// sections for this page

import Projects2 from "./sections-sections/Projects2.js";


function SignupPage() {

  return (
    <>
      <WhiteNavbar />
      <div className="wrapper">
        <div className="section-space"></div>

        <Projects2 />


        <Footer />
      </div>
    </>
  );
}

export default SignupPage;
